class SendEmergencyMsgResponse {  String status;  String msg;  String userId;  SendEmergencyMsgResponse({      this.status,       this.msg,       this.userId});  fromJson(dynamic json) {    status = json['status'];    msg = json['msg'];    userId = json['user_id'];  }  Map<String, dynamic> toJson() {    var map = <String, dynamic>{};    map['status'] = status;    map['msg'] = msg;    map['user_id'] = userId;    return map;  }}